import logo from "../src/assets/logo/logo.png";

export default function App() {
  return (
    <div className="">
      <header className="w-[144px] h-[140px] bg-white">
        <div className="">
          <div>
            <img src={logo} width={149} height={49} alt="logo" />
          </div>
            <div>
                <input  placeholder="search"  type="search" name="search" id="" className="bg-[#D9D9D9] w-[590px] h-[43px] border" />
            </div>
            <div></div>
        </div>
      </header>
    </div>
  );
}
